import React, { Component } from 'react';
import axios from 'axios';


const api = axios
.create({
	baseURL: 'https://api.nytimes.com/svc/mostpopular/v2/viewed/1.json?api-key=mN6Xg33Uh049lVc0uwErmOgdhb4TYBt4'
})
	.catch(err => console.log(err, err.response));


class Articles extends React.Component {

state = {
	articles: [],
	testArray: [1, 4, 5, 9]
}

constructor(){
	super()
		api.get().then(res => {
		console.log(res.data);
		this.setState({ articles: res.data.results})
		this.getArticle = this.getArticle.bind(this);
	})
}

getArticle(){
	const arr = this.state.articles.map(function (article) { return article.title.media['media-metadata']['url']; });
	const valueFromArr = arr[0];
	console.log(arr.data);

	return valueFromArr;
}

 render() {

    return (
<div className="Articles">
<h1>Articles page + {this.getArticle()}</h1>
{this.state.articles.map(function (article) {const a = article.title; return <h2>{a}</h2>})}
</div>
    );
}

}

export default Articles;


